Now more importantly, lets pull out our treatment effect and loss values:

results <- data.frame(
treat <-fit1 %>% 
  extract("treatment") %>% 
  as.vector(),
loss <- fit1 %>% 
  extract("loss") %>% 
  as.vector()
)



Integrating Over Our Loss Function
Here we can summarise our estimated treatment effect and its associated distribution, recall our loss function, and then examine our loss function evaluated at our values of treatment effect.

par(mfrow = c(1,3))
hist(results$treatment, main = "Histogram of Treatment Effect", col = "grey", breaks = 30)
plot(seq(-3, 3, .1), loss_vals, main = "Loss Function")
plot(x = results$treatment, y =  results$loss, main = "Treatment vs Loss")




Results from Model




Finally, we can sum our evaluted loss function and see where we land:

sum(results$loss)

[1] -14390.76


What does it mean? Based on our loss function and treatment effect, it has a negative loss. So it is a slam dunk!

Our Model
This is the same model from this blog post and this one courtsey of James Savage and Peter Ellis.
// Base Syntax from James Savage at https://github.com/khakieconomics/stanecon_short_course/blob/80263f84ebe95be3247e591515ea1ead84f26e3f/03-fun_time_series_models.Rmd
//and modification inspired by Peter Ellis at https://github.com/ellisp/ozfedelect/blob/master/model-2pp/model-2pp.R

data {
  int polls; // number of polls
  int T; // number of days
  matrix[T, polls] Y; // polls
  matrix[T, polls] sigma; // polls standard deviations
  real inflator;         // amount by which to multiply the standard error of polls
  real initial_prior;
  real random_walk_sd;
  real mu_sigma;
}
parameters {
  vector[T] mu; // the mean of the polls
  real<lower = 0> tau; // the standard deviation of the random effects
  matrix[T, polls] shrunken_polls;
}
model {
  // prior on initial difference
  mu[1] ~ normal(initial_prior, mu_sigma);
  tau ~ student_t(4, 0, 5);
  // state model
  for(t in 2:T) {
    mu[t] ~ normal(mu[t-1], random_walk_sd);
  }

  // measurement model
  for(t in 1:T) {
    for(p in 1:polls) {
      if(Y[t, p] != -9) {
        Y[t,p]~ normal(shrunken_polls[t, p], sigma[t,p] * inflator);
        shrunken_polls[t, p] ~ normal(mu[t], tau);
      } else {
        shrunken_polls[t, p] ~ normal(0, 1);
      }
    }
  }
}

Build Model in Stan
Now we can build the model in Stan as shown below. Ideally, I would write the ODE solver using the new syntax, but I’ll leave that to next time. We can see that the differential equations have been built into the “sir” function.

mod <- cmdstan_model("sir.stan")

mod$print()

Warning in readLines(self$stan_file()): incomplete final line found on
'/Users/michael/blog/quarto-blog/programming/2020-08-28-bayesian-sir/sir.stan'


// Based on https://mc-stan.org/users/documentation/case-studies/boarding_school_case_study.html
functions {
  real[] sir(real t, real[] y, real[] theta,
             real[] x_r, int[] x_i) {

      real S = y[1];
      real E = y[2];
      real I = y[3];
      real R = y[4];
      real N = x_i[1];

      real beta = theta[1];
      real delta = theta[2];
      real gamma = theta[3];

      real dS_dt = -beta * I * S / N;
      real dE_dt =  beta * I * S / N - delta * E;
      real dI_dt =  delta*E - gamma * I;
      real dR_dt =  gamma * I;

      return {dS_dt, dE_dt, dI_dt, dR_dt};
  }
}
data {
  int<lower=1> n_days;
  real y0[4];
  real t0;
  real ts[n_days];
  int N;
  int cases[n_days-1];
  int n_pred;
  real ts_pred[n_pred];
  real delta_mu;
}
transformed data {
  real x_r[0];
  int x_i[1] = { N };

}
parameters {
  real<lower=0> theta[3];
  real<lower=0> phi_inv;

}
transformed parameters{
  real y[n_days, 3];
  real<lower=0> phi = 1. / phi_inv;
  real<lower=0> incidence[n_days-1];

  {

    y = integrate_ode_rk45(sir, y0, t0, ts, theta, x_r, x_i);
  }

  //for (i in 2:(n_days-1)) {
   for (i in 1:(n_days-1))
    incidence[i] = y[i, 1] - y[i + 1, 1];


}
model {
  //priors
  theta[1]~ normal(2, 1); //beta
  theta[2]~ normal(delta_mu, .1); //delta
  theta[3]~ normal(0.1, 0.7); //gamma
  phi_inv ~ exponential(2);

  cases ~ neg_binomial_2(incidence, phi);

}
generated quantities {
  real R0 = theta[1] / theta[3];
  real recovery_time = 1 / theta[3];
  real pred_cases[n_days-1];
  real pred_cases_out[n_pred-1];
  real pred_incidence[n_pred-1];

  // future prediction parameters
  real y_pred[n_pred, 3];
  real y_init_pred[3] = y[n_days, ]; // New initial conditions
  real t0_pred = ts[n_days];        // New time zero is the last observed time

  pred_cases = neg_binomial_2_rng(incidence, phi);

  y_pred = integrate_ode_rk45(sir, y_init_pred, t0_pred, ts_pred, theta, x_r, x_i);

  for (i in 1:(n_pred-1))
    pred_incidence[i] = y_pred[i, 1] - y_pred[i + 1, 1];

    pred_cases_out = neg_binomial_2_rng(pred_incidence, phi);


}



Build Dataset
Now we can prep our dataset for Stan.

# total count
N <- 1000;

# times
n_days <- length(cases) +1
t <- seq(0, n_days, by = 1)
t0 = 0
t <- t[-1]

#initial conditions
i0 <- 1
e0 <- 0
s0 <- N - i0
r0 <- 0
y0 = c(S = s0, E = e0, I = i0, R = r0)



Run the Model
Then we can run it using CmdStanR.

# number of MCMC steps
niter <- 2000

n_pred <- 21

data_sir<- list(n_days = n_days, 
                        y0 = y0,
                        t0 = t0, ts = t, 
                        N = N, cases = cases,
                        n_pred = n_pred,delta_mu=.2,
                        ts_pred = seq(n_days+1, n_days+n_pred, by = 1)
                        )

fit <- mod$sample(data = data_sir,
                  adapt_delta = .9,
                  chains = 2, 
                  max_treedepth = 12,
                  parallel_chains = 2,
                  iter_sampling = niter/2,
                  refresh = 0,
                  iter_warmup = niter/2)

